import React from 'react';
import { BrowserRouter as Router, Route, Switch } from 'react-router-dom';
import Play from './Play'
import Game from './Game'
import PlayWithFriends from './PlayWithFriends'
import '../node_modules/bootstrap/dist/css/bootstrap.min.css'; 
import WaitingRoom from './WaitingRoom';
import store from './store/';
import { Provider } from 'react-redux';
import Login from './Login'
import OAuth2RedirectHandler from './OAuth2RedirectHandler'
import Home from './Home'
import ChessGame from './ChessGame';
import PrivateRoute from './PrivateRoute'

function App() {
  return (
    <div className="App">
      <Provider store={store}>
      <Router>
        <Switch>
          <Route component={Login} exact path="/" />
          {/* <Route component={Play} path="/play" />  */}
          <PrivateRoute component={Home} path="/home" />
          <PrivateRoute component={ChessGame} path="/game" />
          {/* <Route component={PlayWithFriends} path="/playWithFriends" /> */}
          {/* <Route component={WaitingRoom} path="/waitingroom" /> */}
          <Route component={OAuth2RedirectHandler} path="/oauth2/redirect"></Route> 
        </Switch>
      </Router>
      </Provider>
    </div>
  );
}

export default App;

// only if you give exact path, others also wont get included
